    });
}",paramEditorEvent:"if (name === 'filterselector') {
    if (event === 'click') {
        switch (param) {
            case 1: // Letztes Jahr
                editUtil.setEditorOption('from', 'value', util.beginOfLastYear());
                editUtil.setEditorOption('to', 'value', util.endOfLastYear());

                actions.loadData({
                    from: editUtil.getEditorOption('from', 'value').toISOString(),
                    to: editUtil.getEditorOption('to', 'value').toISOString()
                });
                break;
            case 2: // Aktuelles Jahr
                editUtil.setEditorOption('from', 'value', util.beginOfYear());
                editUtil.setEditorOption('to', 'value', util.endOfYear());

                actions.loadData({
                    from: editUtil.getEditorOption('from', 'value').toISOString(),
                    to: editUtil.getEditorOption('to', 'value').toISOString()
                });
                break;
            default: // Eingegebenen Zeitfilter anwenden
                actions.loadData({
                    from: editUtil.getEditorOption('from', 'value').toISOString(),
                    to: editUtil.getEditorOption('to', 'value').toISOString()
                });
                break;
        }
    }
